import React, { Component } from 'react';


class App extends Component {
  componentDidMount() {
    const url = "http://localhost:5000/login"
    fetch(url, {
      headers: {
        'Accept': 'application/json',
        'Content-Type': 'application/json'
      },
      method: 'post',
      body: JSON.stringify({
        username: 'root',
        password: '123456'
      })
    })
    .then(res=> { return res.json() })
    .then(res=> { 
      if(!res) {
        console.log("login failed");
      } else {
        console.log(res);
      }
    })
  }

  render() {
    return(
      <h1>Hello react</h1>
    )
  }
}

export default App;
